The CHOOSE FRANCE TOUR, an education fair where you will get the opportunity to interact with numerous French universities from the comfort of your home!

On 6th & 7th November, French universities & institutions are opening doors to its French culture for you all. They will gather to meet you on a virtual platform and will present their graduate, post-graduate and doctoral programs.

Register for free and get free counselling from leading French institutions, access to webinars by the Campus France managers & representatives and an opportunity to win various exciting prizes and vouchers. 

To register for free, click on the link in my bio and save yourself a spot for a one-on-one! 

